// ExerciseLibrary.js
import React from 'react';

const exercises = [
  {
    name: "Squat",
    category: "Legs",
    tags: ["Medium Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/4/4e/Squats.gif"
  },
  {
    name: "Lunges",
    category: "Legs",
    tags: ["High Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/8/8a/Lunges.gif"
  },
  {
    name: "Push-ups",
    category: "Chest",
    tags: ["Medium Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/0/05/Pushups-2.gif"
  },
  {
    name: "Plank",
    category: "Core",
    tags: ["Low Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/3/31/Plank.gif"
  },
  {
    name: "Shoulder Press",
    category: "Shoulders",
    tags: ["Medium Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/e/e4/Shoulder-press.gif"
  },
  {
    name: "Bicep Curls",
    category: "Arms",
    tags: ["Low Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/f/fd/Biceps_curl.gif"
  },
  {
    name: "Deadlift",
    category: "Back",
    tags: ["High Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/2/2e/Deadlift.gif"
  },
  {
    name: "Tricep Dips",
    category: "Arms",
    tags: ["Medium Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/1/1b/Dips.gif"
  },
  {
    name: "Mountain Climbers",
    category: "Cardio",
    tags: ["High Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/5/53/Mountain_Climbers.gif"
  },
  {
    name: "Jumping Jacks",
    category: "Cardio",
    tags: ["Low Intensity"],
    image: "https://upload.wikimedia.org/wikipedia/commons/6/6e/Jumping-jacks.gif"
  }
];

const ExerciseLibrary = () => {
  return (
    <div className="exercise-library" style={{ padding: '20px' }}>
      <h1>Exercise Library</h1>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(220px, 1fr))', gap: '20px' }}>
        {exercises.map((exercise, index) => (
          <div key={index} style={{ border: '1px solid #ccc', borderRadius: '12px', padding: '10px', textAlign: 'center', boxShadow: '2px 2px 10px rgba(0,0,0,0.1)' }}>
            <img src={exercise.image} alt={exercise.name} style={{ width: '100%', height: '160px', objectFit: 'cover', borderRadius: '8px' }} />
            <h3>{exercise.name}</h3>
            <p><strong>Category:</strong> {exercise.category}</p>
            <p><strong>Tags:</strong> {exercise.tags.join(', ')}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ExerciseLibrary;
